import React from 'react'
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import { styled } from '@mui/material/styles';
import {
  DataGrid,
  GridToolbarQuickFilter,
  GridLinkOperator,
} from '@mui/x-data-grid';
import Container from '@mui/material/Container';

const columns = [
    { field: 'id', headerName: 'ลำดับ', width: 90 },
    {
      field: 'parcelnumber',
      headerName: 'เลขพัสดุ',
      width: 150,
      editable: true,
    },
    {
      field: 'parcelname',
      headerName: 'ชื่อพัสดุ',
      width: 150,
      editable: true,
    },
    {
      field: 'quantity',
      headerName: 'จำนวน',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
        field: 'unit',
        headerName: 'หน่วย',
        width: 150,
        editable: true,
      },
      {
        field: 'status',
        headerName: 'สถานะ',
        width: 150,
        editable: true,
      },
      {
        field: 'withdraw',
        headerName: 'เบิก',
        width: 150,
        editable: true,
      },
      {
        field: 'management',
        headerName: 'การจัดการ',
        width: 150,
        editable: true,
      },
  ];
  
  const rows = [
    { id: 1, parcelnumber: '001', parcelname: 'ปากกา', quantity: 35 },
    { id: 2, parcelnumber: '002', parcelname: 'ปากกา', quantity: 42 },
    { id: 3, parcelnumber: '003', parcelname: 'ปากกา', quantity: 45 },
    { id: 4, parcelnumber: '004', parcelname: 'ปากกา', quantity: 16 },
    { id: 5, parcelnumber: '005', parcelname: 'ปากกา', age: null },
    { id: 6, parcelnumber: '006', parcelname: 'ปากกา', age: 150 },
    { id: 7, parcelnumber: '007', parcelname: 'ปากกา', age: 44 },
    { id: 8, parcelnumber: '008', parcelname: 'ปากกา', age: 36 },
    { id: 9, parcelnumber: '009', parcelname: 'ปากกา', age: 65 },
  ];


const DrawerHeader = styled('div')(({ theme }) => ({
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-end',
    padding: theme.spacing(0, 1),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
  }));

  function QuickSearchToolbar() {
    return (
      <Box
        sx={{
          p: 0.5,
          pb: 0,
        }}
      >
        <GridToolbarQuickFilter
          quickFilterParser={(searchInput) =>
            searchInput
              .split(',')
              .map((value) => value.trim())
              .filter((value) => value !== '')
          }
        />
      </Box>
    );
  }

function PageParcelList() {
  return (
    <div>
        <Box sx={{width: "100%",height: "100%"}}>
        <DrawerHeader />

            <Box sx={{textAlign: "center"}}>
            <Typography
              variant="subtitle1"
              sx={{ color: "#ffffff", fontWeight: "bold", fontSize: "24px" }}
            >
              รายการพัสดุ
            </Typography>
            </Box>
            <DrawerHeader />
            <Container >
            <Box sx={{ height: 400, width: 1 ,backgroundColor:'#ffffff'}}>
      <DataGrid
         rows={rows}
        columns={columns}
        initialState={{
          filter: {
            filterModel: {
              items: [],
              quickFilterLogicOperator: GridLinkOperator.Or,
            },
          },
        }}
        components={{ Toolbar: QuickSearchToolbar }}
      />
    </Box>
    </Container>
        </Box>
    </div>
  )
}

export default PageParcelList
